import React,{Component} from 'react';


class BillView extends Component
{
    render() {
        return(
            <div style={viewStyle}>
                <h2>Receipt</h2>
            </div>
        );

    }
}
const viewStyle={
    left:"200px",
    right:"200px",
    textAlign:"center"
}
export default BillView
